import React, { useState } from "react";
import "../assets/css/Cotacao.css";

const Cotacao = () => {
  // Estado inicial do formulário
  const [form, setForm] = useState({
    cepOrigem: "74672856",
    cepDestino: "",
    valorNotaFiscal: "",
    entregaDomicilio: false,
    retiraTerminal: false,
    pagamentoOrigem: false,
    pagamentoDestino: false,
    volumes: [{ altura: 10, largura: 10, comprimento: 10, peso: 0 }],
  });

  // Manipular mudança de estado nos checkboxes
  const handleCheckboxChange = (campo) => {
    setForm((prevForm) => {
      let novoEstado = { ...prevForm, [campo]: !prevForm[campo] };

      // Se "Pagamento no Destino" for marcado, "Entrega a Domicílio" é desativado
      if (campo === "pagamentoDestino" && novoEstado.pagamentoDestino) {
        novoEstado.entregaDomicilio = false;
      }

      // Se "Entrega a Domicílio" for marcado, "Pagamento no Destino" é desativado
      if (campo === "entregaDomicilio" && novoEstado.entregaDomicilio) {
        novoEstado.pagamentoDestino = false;
      }

      // Se "Retira no Terminal" for marcado, desmarcar "Entrega a Domicílio"
      if (campo === "retiraTerminal" && novoEstado.retiraTerminal) {
        novoEstado.entregaDomicilio = false;
      }

      // Se "Entrega a Domicílio" for marcado, desmarcar "Retira no Terminal"
      if (campo === "entregaDomicilio" && novoEstado.entregaDomicilio) {
        novoEstado.retiraTerminal = false;
      }

      return novoEstado;
    });
  };

  // Manipular mudança de estado nos campos de entrada
  const handleChange = (e) => {
    const { name, value } = e.target;
    setForm((prevForm) => ({
      ...prevForm,
      [name]: value,
    }));
  };

  // Simulação de cotação
  const calcularCotacao = () => {
    console.log("Cotação enviada:", form);
  };

  return (
    <div className="cotacao-container">
      <h1>Calculadora de Frete</h1>

      <div className="form-container">
        <div className="coluna-esquerda">
          <label>Origem:</label>
          <input type="text" value="GOIANIA-GO" disabled />

          <label>CEP de Destino:</label>
          <input
            type="text"
            name="cepDestino"
            value={form.cepDestino}
            onChange={handleChange}
          />

          <label>Valor total dos Produtos:</label>
          <input
            type="text"
            name="valorNotaFiscal"
            value={form.valorNotaFiscal}
            onChange={handleChange}
          />
        </div>

        <div className="coluna-direita">
          <div className="checkbox-group">
            <strong>Entrega</strong>
            <label>
              <input
                type="checkbox"
                checked={form.entregaDomicilio}
                onChange={() => handleCheckboxChange("entregaDomicilio")}
                disabled={form.pagamentoDestino} // Desativa se pagamento no destino estiver marcado
              />
              Entrega a Domicílio
            </label>
            <label>
              <input
                type="checkbox"
                checked={form.retiraTerminal}
                onChange={() => handleCheckboxChange("retiraTerminal")}
              />
              Retira no Terminal de Cargas
            </label>
          </div>

          <div className="checkbox-group">
            <strong>Pagamento</strong>
            <label>
              <input
                type="checkbox"
                checked={form.pagamentoOrigem}
                onChange={() => handleCheckboxChange("pagamentoOrigem")}
              />
              Origem
            </label>
            <label>
              <input
                type="checkbox"
                checked={form.pagamentoDestino}
                onChange={() => handleCheckboxChange("pagamentoDestino")}
                disabled={form.entregaDomicilio} // Desativa se entrega a domicílio estiver marcada
              />
              Destinatário
            </label>
          </div>
        </div>
      </div>

      <div className="button-group">
        <button className="calcular-button" onClick={calcularCotacao}>
          CALCULAR
        </button>
      </div>

      <div className="resultado-container">
        <h2>Resultado da Cotação</h2>
        {form.retiraTerminal && form.cepDestino ? (
          <p>
            O cliente deverá retirar a mercadoria no aeroporto correspondente ao
            destino informado.
          </p>
        ) : (
          <p>Aqui será exibido o resultado do cálculo.</p>
        )}
      </div>
    </div>
  );
};

export default Cotacao;
